        for (int i = 0; i < this.rcount; i++) {
            this.salt.add(new byte[this.hashSize]);
            this.encryptedVerifier.add(new byte[this.hashSize]);
        }
        int pos = offset + 16;
        for (int i = 0; i < this.rcount; i++) {
            System.arraycopy(data, pos, this.salt.get(i), 0, this.hashSize);
            pos += this.hashSize;
        }
        for (int i = 0; i < this.rcount; i++) {
            System.arraycopy(data, pos, this.encryptedVerifier.get(i), 0, this.hashSize);
            pos += this.hashSize;
        }
        if ((this.flags & 4) != 0) {
            this.agcount = ZipShort.getValue(data, pos);
            pos += 2;
            for (int i = 0; i < this.agcount; i++) {
                this.authenticatedAttributes.add(Arrays.copyOfRange(data, pos, pos + 4));
                pos += 4;
            }
        }
    }
}

